  static List<double> lonLatToSvg(double lon, double lat) {
    return [(lon - 128.0) * 30, (46.0 - lat) * 36];
  }

  static List<double> lonLatToSvgOki(double lon, double lat) {
    final dx = (lon - _okiCenterLon) * 30 * _okiScale;
    final dy = (_okiCenterLat - lat) * 36 * _okiScale;
    return [_okiTargetX + dx, _okiTargetY + dy];
  }

  static bool isOkinawaRegion(double lon, double lat) {
    return lat < 28.5 && lon < 132;
  }
}

class _JapanMapWidgetState extends State<JapanMapWidget> {
  String? _selectedAirport;
  Map<String, Offset> _airportPixelPositions = {};
  Size _lastSize = Size.zero;

  void _updatePixelPositions(Size size) {
    _lastSize = size;
    final sx = size.width / JapanMapWidget._viewBoxW;
    final sy = size.height / JapanMapWidget._viewBoxH;
    final ox = -JapanMapWidget._viewBoxX * sx;
    final oy = -JapanMapWidget._viewBoxY * sy;

    _airportPixelPositions = {};
    for (final entry in widget.airportLocations.entries) {
      final loc = entry.value;
      final lon = loc['lon'] ?? 0;
      final lat = loc['lat'] ?? 0;
      if (lon == 0 || lat == 0) continue;

      final svgXY = JapanMapWidget.isOkinawaRegion(lon, lat)
          ? JapanMapWidget.lonLatToSvgOki(lon, lat)
          : JapanMapWidget.lonLatToSvg(lon, lat);

      final px = svgXY[0] * sx + ox;
      final py = svgXY[1] * sy + oy;

      if (px >= 0 && py >= 0 && px <= size.width && py <= size.height) {
        _airportPixelPositions[entry.key] = Offset(px, py);
      }
    }
  }

  String? _hitTest(Offset tapPos, Size size) {
    _updatePixelPositions(size);
    final hitRadius = size.width < 300 ? 20.0 : 24.0;

    String? closest;
    double closestDist = double.infinity;

    for (final entry in _airportPixelPositions.entries) {
      final dist = (entry.value - tapPos).distance;
      if (dist < hitRadius && dist < closestDist) {
        closestDist = dist;
        closest = entry.key;
      }
    }
    return closest;
  }

  @override
  Widget build(BuildContext context) {
    return LayoutBuilder(
      builder: (context, constraints) {
        final w = constraints.maxWidth;
        final h = w * (JapanMapWidget._viewBoxH / JapanMapWidget._viewBoxW);

        return GestureDetector(
          behavior: HitTestBehavior.opaque,
          onTapUp: (details) {
            final size = Size(w, h);
            _updatePixelPositions(size);
            final hit = _hitTest(details.localPosition, size);
            setState(() {
              _selectedAirport = (hit == _selectedAirport) ? null : hit;
            });
          },
          child: SizedBox(
            width: w,
            height: h,
            child: CustomPaint(
              size: Size(w, h),
              painter: _JapanMapPainter(
                widget.prefStatus,
                widget.airportLocations,
                widget.airportNames,
                widget.checkedAirports,
                _selectedAirport,
              ),
            ),
          ),
        );
      },
    );
  }
}

class _JapanMapPainter extends CustomPainter {
  final Map<String, int> prefStatus;
  final Map<String, Map<String, double>> airportLocations;
  final Map<String, String> airportNames;
  final Set<String> checkedAirports;
  final String? selectedAirport;

  _JapanMapPainter(
    this.prefStatus,
    this.airportLocations,
    this.airportNames,
    this.checkedAirports,
    this.selectedAirport,
  );

  @override
  void paint(Canvas canvas, Size size) {
    final scaleX = size.width / JapanMapWidget._viewBoxW;
    final scaleY = size.height / JapanMapWidget._viewBoxH;
    final offsetX = -JapanMapWidget._viewBoxX * scaleX;
    final offsetY = -JapanMapWidget._viewBoxY * scaleY;

    _drawOkinawaBox(canvas, scaleX, scaleY, offsetX, offsetY);

    for (final entry in JapanMapWidget._prefPaths.entries) {
      final code = entry.key;
      final pathStr = entry.value;
      final status = prefStatus[code] ?? 0;

      final path = _parseSvgPath(pathStr, scaleX, scaleY, offsetX, offsetY);

      canvas.drawPath(
        path,
        Paint()
          ..style = PaintingStyle.fill
          ..color = _getColor(status),
      );

      canvas.drawPath(
        path,
        Paint()
          ..style = PaintingStyle.stroke
          ..strokeWidth = status == 2 ? 1.5 : 0.5
          ..color = _getStrokeColor(status),
      );
    }

    _drawAirportMarkers(canvas, scaleX, scaleY, offsetX, offsetY, size);

    if (selectedAirport != null) {
      _drawTooltip(canvas, scaleX, scaleY, offsetX, offsetY, size);
    }
  }

  void _drawOkinawaBox(
    Canvas canvas,
    double sx,
    double sy,
    double ox,
    double oy,
  ) {
    final linePaint = Paint()
      ..style = PaintingStyle.stroke
      ..strokeWidth = 0.8
      ..color = Colors.grey[400]!;

    // :   
    final startX = 40.0 * sx + ox;
    final startY = 720.0 * sy + oy;
    final junctionX = 370.0 * sx + ox;
    final junctionY = 490.0 * sy + oy;
    canvas.drawLine(
      Offset(startX, startY),
      Offset(junctionX, junctionY),
      linePaint,
    );

    // :  
    final endX = 545.0 * sx + ox;
    canvas.drawLine(
      Offset(junctionX, junctionY),
      Offset(endX, junctionY),
      linePaint,
    );
  }

  void _drawAirportMarkers(
    Canvas canvas,
    double sx,
    double sy,
    double ox,
    double oy,
    Size size,
  ) {
    if (airportLocations.isEmpty) return;

    final markerSize = size.width < 300 ? 8.0 : 10.0;

    for (final entry in airportLocations.entries) {
      final code = entry.key;
      final loc = entry.value;
      final lon = loc['lon'] ?? 0;
      final lat = loc['lat'] ?? 0;
      if (lon == 0 || lat == 0) continue;

      final svgXY = JapanMapWidget.isOkinawaRegion(lon, lat)
          ? JapanMapWidget.lonLatToSvgOki(lon, lat)
          : JapanMapWidget.lonLatToSvg(lon, lat);

      final px = svgXY[0] * sx + ox;
      final py = svgXY[1] * sy + oy;

      if (px < 0 || py < 0 || px > size.width || py > size.height) continue;

      final isChecked = checkedAirports.contains(code);
      final isSelected = selectedAirport == code;

      if (isSelected) {
        canvas.drawCircle(
          Offset(px, py),
          markerSize * 1.0,
          Paint()
            ..style = PaintingStyle.stroke
            ..strokeWidth = 2.0
            ..color = Colors.orange,
        );
      }

      final tp = TextPainter(
        text: TextSpan(
          text: '',
          style: TextStyle(
            fontSize: markerSize * 1.1,
            color: isChecked ? Colors.amber : Colors.white70,
          ),
        ),
        textDirection: TextDirection.ltr,
      );
      tp.layout();
      tp.paint(canvas, Offset(px - tp.width / 2, py - tp.height / 2));
    }
  }

  void _drawTooltip(
    Canvas canvas,
    double sx,
    double sy,
    double ox,
    double oy,
    Size size,
  ) {
    final code = selectedAirport!;
    final loc = airportLocations[code];
    if (loc == null) return;

    final lon = loc['lon'] ?? 0;
    final lat = loc['lat'] ?? 0;
    if (lon == 0 || lat == 0) return;

    final svgXY = JapanMapWidget.isOkinawaRegion(lon, lat)
        ? JapanMapWidget.lonLatToSvgOki(lon, lat)
        : JapanMapWidget.lonLatToSvg(lon, lat);

    final px = svgXY[0] * sx + ox;
    final py = svgXY[1] * sy + oy;

    final isChecked = checkedAirports.contains(code);
    final name = airportNames[code] ?? '';

    // Build label: " (CODE)" or just "CODE" if no name
    String label;
    if (name.isNotEmpty && name != code) {
      label = '$name ($code)';
    } else {
      label = code;
    }
    if (isChecked) label += ' ';

    final textStyle = TextStyle(
      fontSize: 12,
      color: Colors.white,
      fontWeight: FontWeight.bold,
    );
    final tp = TextPainter(
      text: TextSpan(text: label, style: textStyle),
      textDirection: TextDirection.ltr,
    );
    tp.layout();

    const padH = 8.0;
    const padV = 5.0;
    final tooltipW = tp.width + padH * 2;
    final tooltipH = tp.height + padV * 2;
    const arrowH = 6.0;

    var tooltipX = px - tooltipW / 2;
    var tooltipY = py - tooltipH - arrowH - 8;
    bool arrowDown = true;

    if (tooltipY < 2) {
      tooltipY = py + arrowH + 8;
      arrowDown = false;
    }
    if (tooltipX < 2) tooltipX = 2;
    if (tooltipX + tooltipW > size.width - 2)
      tooltipX = size.width - tooltipW - 2;

    final rect = RRect.fromRectAndRadius(
      Rect.fromLTWH(tooltipX, tooltipY, tooltipW, tooltipH),
      const Radius.circular(6),
    );

    canvas.drawRRect(
      rect.shift(const Offset(1, 1)),
      Paint()..color = Colors.black26,
    );

    final bgColor = isChecked ? Colors.amber[800]! : Colors.grey[800]!;
    canvas.drawRRect(rect, Paint()..color = bgColor);

    final arrowPath = Path();
    final arrowCx = px.clamp(tooltipX + 10, tooltipX + tooltipW - 10);
    if (arrowDown) {
      arrowPath.moveTo(arrowCx - 5, tooltipY + tooltipH);
      arrowPath.lineTo(arrowCx, tooltipY + tooltipH + arrowH);
      arrowPath.lineTo(arrowCx + 5, tooltipY + tooltipH);
    } else {
      arrowPath.moveTo(arrowCx - 5, tooltipY);
      arrowPath.lineTo(arrowCx, tooltipY - arrowH);
      arrowPath.lineTo(arrowCx + 5, tooltipY);
    }
    arrowPath.close();
    canvas.drawPath(arrowPath, Paint()..color = bgColor);

    tp.paint(canvas, Offset(tooltipX + padH, tooltipY + padV));
  }

  Color _getColor(int status) {
    if (status == 3) return const Color(0xFF1A1A1A); // : 
    if (status == 2) return const Color(0xFF1A1A1A); // : 
    if (status >= 10 && status <= 19) {
      // : 
      final ratio = (status - 10) / 9.0;
      final v = (0xC8 - (0xC8 - 0x1A) * ratio).round();
      return Color.fromARGB(255, v, v, v);
    }
    return const Color(0xFFC8C8C8); // : 
  }

  Color _getStrokeColor(int status) {
    if (status == 2) return Colors.red.withOpacity(0.9); // : 
    if (status == 3) return const Color(0xFF2A2A2A); // : 
    if (status >= 10 && status <= 19) return Colors.white.withOpacity(0.4); // 
    return Colors.white.withOpacity(0.6); // 
  }

  Path _parseSvgPath(String d, double sx, double sy, double ox, double oy) {
    final path = Path();
    final parts = d.split(RegExp(r'(?=[MLZ])'));
    for (final part in parts) {
      if (part.isEmpty) continue;
      final cmd = part[0];
      if (cmd == 'Z') {
        path.close();
        continue;
      }
      final xy = part.substring(1).split(',');
      if (xy.length == 2) {
        final x = (double.tryParse(xy[0]) ?? 0) * sx + ox;
        final y = (double.tryParse(xy[1]) ?? 0) * sy + oy;
        if (cmd == 'M')
          path.moveTo(x, y);
        else
          path.lineTo(x, y);
      }
    }
    return path;
  }

  @override
  bool shouldRepaint(covariant _JapanMapPainter old) {
    return old.prefStatus != prefStatus ||
        old.checkedAirports != checkedAirports ||
        old.airportLocations != airportLocations ||
        old.selectedAirport != selectedAirport;
  }
}
